import CalorieRecord from "./CalorieRecord";

import style from "./RecordList.module.css";

const RecordList = (props) => {
  const records = props.records || []; // Default to an empty array
  return (
    <ul className={style["record-list"]}>
      {records.map((record) =>
        record.calories >= 0 ? (
          <li className={style["list-item"]} key={record.id}>
            <CalorieRecord
              date={record.date}
              meal={record.meal}
              content={record.content}
              calories={record.calories}
            />
          </li>
        ) : null
      )}
    </ul>
  );
};

export default RecordList;
